// pages/Settings.js
import React, { useState } from 'react';

const Settings = () => {
  const [activeTab, setActiveTab] = useState('subscription'); // Initially set the active tab to 'subscription'

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  return (
    <div className="settings">
      <div className="tabs">
        <button onClick={() => handleTabChange('subscription')} className={activeTab === 'subscription' ? 'active' : ''}>
          Subscription Plan
        </button>
        <button onClick={() => handleTabChange('appearances')} className={activeTab === 'appearances' ? 'active' : ''}>
          Appearances
        </button>
      </div>

      <div className="tab-content">
        {activeTab === 'subscription' && (
          <div>
            {/* Subscription Plan content */}
            <h2>Subscription Plan</h2>
            {/* Add your subscription plan content here */}
          </div>
        )}

        {activeTab === 'appearances' && (
          <div>
            {/* Appearances content */}
            <h2>Appearances</h2>
            {/* Add your appearances content here */}
          </div>
        )}
      </div>
    </div>
  );
};

export default Settings;
